pragma solidity ^0.5.0;
import './MedicalHistory.sol';

contract Agent {


    address public myAddress;
    string public name;
    string public uid;
    string public did;
    string public password;
    string public aType;
    string public publicKey;


    constructor(address ma, string memory nm,string memory ui, string memory di, string memory pass, string memory tp, string memory pbKey) public{
        myAddress = ma;
        name = nm;
        uid = ui;
        did = di;
        password = pass;
        aType = tp;
        publicKey = pbKey;
    }

}
